import React from 'react';
import { Text, View } from 'react-native';
function CheckOut() {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>CheckOut Screen</Text>
        </View>
    )
}
export default CheckOut
